import { Nav, Button, Image, Navbar } from "react-bootstrap";

const Banner = () => {
  return (
    <>
      <div className="banner">
        <div className="banner-overlay"></div>
        <div className="banner-content p-5">
          <div className="d-flex justify-content-between align-items-center">
            <div className="text-left">
              <h1 className="title">JEAN CARLOS ZAMUDIO LABÁN</h1>
              <p className="profession">Soy un Ingeniero de Software y me considero un aficionado por la tecnología y 
              siempre estoy a la vanguardia con el surgimiento de nuevas tecnologías.</p>
              <Button variant="outline-info">Download CV</Button>
            </div>
            <div className="text-right">
              <Image
                src="https://avatars.githubusercontent.com/u/133301187?v=4"
                roundedCircle
                width={50}
                height={50}
              />
            </div>
          </div>
        </div>
      </div>
    </>
  );
};

export default Banner;
